export const buyItem = (dispatch, item) => {
    console.log(item)
    dispatch({
        type: BUY_ITEM,
        payload: item
    });
};

export const removeFeature = (dispatch, item) => {
    console.log(item)
        dispatch({
        type: REMOVE_FEATURE,
        payload: item
    });
}
